/* exam.js
 * This page is responsible for the actual exam portion.
 * Should grab a quiz from the database then give the user to solve questions
 * 
 * Daniel
 */

import React from 'react';
import axios from 'axios';

// ...

class Exam extends React.Component {
    state = {
      quizID: '',
      posts: []
    };

    // ...

    displayQuiz = (posts) => {
      const map = posts.map((post, index) => (
        <div id={index} key={index}>
          <form>
            <h1 id={post.title}>{post.title}</h1>
            <p id={post.creator}>By {post.creator}</p>
            <p>#{index + 1}: {post.questions.q1.question}</p>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 1}`} value="option1" />
                {post.questions.q1.options.a1}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 1}`} value="option2" />
                {post.questions.q1.options.a2}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 1}`} value="option3" />
                {post.questions.q1.options.a3}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 1}`} value="option4" />
                {post.questions.q1.options.a4}
              </label>
            </div>
            <br></br>
            <p>#{index + 2}: {post.questions.q2.question}</p>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 2}`} value="option1" />
                {post.questions.q2.options.a1}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 2}`} value="option2" />
                {post.questions.q2.options.a2}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 2}`} value="option3" />
                {post.questions.q2.options.a3}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 2}`} value="option4" />
                {post.questions.q2.options.a4}
              </label>
            </div>
            <br></br>
            <p>#{index + 3}: {post.questions.q3.question}</p>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 3}`} value="option1" />
                {post.questions.q3.options.a1}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 3}`} value="option2" />
                {post.questions.q3.options.a2}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 3}`} value="option3" />
                {post.questions.q3.options.a3}
              </label>
            </div>
            <div className="radio">
              <label>
                <input type="radio" name={`q${index + 3}`} value="option4" />
                {post.questions.q3.options.a4}
              </label>
            </div>
            <br></br>
            <button type="button" className="btn btn-outline-light">Submit</button>
          </form>
        </div>
      ));

      return map;
    }

    // Updates the state of the target.
    handleEventUpdate = (event) => {
        const target = event.target;
        const name = target.name; 
        const value = target.value;

        this.setState({
          [name]: value
        })
      };


    // Renders quiz
    render(){
        return(
            <div className='text-center text-white container'>
                {this.displayQuiz(this.state.posts)}
            </div>
        );
    }
}

export default Exam;
